import { Link } from 'react-router-dom'

const Footer = () => {
  return (
    <div className=' bg-richblack-800 w-11/12 max-w-[1200px] mx-auto text-richblack-300 text-[14px] font-inter leading-[22px]'>
        {/* top portion */}
        {/* horizontal line */}
        {/* bottom-part */}
        <div>
            {/* left part */}
                <div>
                    <Link to={"/privacyPolicy"}><div>Privacy Policy</div></Link>
                    <Link to={"/cookiePolicy"}><div>Cookie Policy</div></Link>
                    <Link to={"/terms"}><div>Terms</div></Link>
                </div>
            {/* right part */}
                <div>
                Made with <span className=' text-[#EF476F]'>♥</span> CodeHelp © 2023 RobinAcedamy
                </div>
        </div>
    </div>
  )
}

export default Footer
